" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 619px\">",
"   <div class=\"ttl\">",
"    Algorithm for stepped pharmacotherapy for generalized anxiety disorder",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 599px; height: 515px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
