"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Late puberty (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/late-puberty-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H11142931\">",
"      <span class=\"h1\">",
"       What is late puberty?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Puberty is a term for the changes in the body that happen as a child becomes an adult. Late puberty is when a child starts puberty much later than normal. The body changes in late puberty are the same as those in normal puberty. They just happen when a child is older.",
"     </p>",
"     <p>",
"      Puberty usually starts between ages 9 to 12 in girls and ages 10 to 13 in boys. With late puberty:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        A girl hasn&rsquo;t shown any signs of puberty by age 12. Usually, the first sign of puberty in girls is that the breasts grow bigger.",
"       </li>",
"       <li>",
"        A boy hasn&rsquo;t shown any signs of puberty by age 14. Usually, the first sign of puberty in boys is that the testicles get bigger (",
"        <a class=\"graphic graphic_figure graphicRef68075 \" href=\"UTD.htm?21/43/22194\">",
"         figure 1",
"        </a>",
"        ).",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H11142946\">",
"      <span class=\"h1\">",
"       What causes late puberty?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Puberty is caused by hormones in the body. The brain makes hormones that start puberty. These hormones travel to the testicles (in boys), and the ovaries (in girls) (",
"      <a class=\"graphic graphic_figure graphicRef68075 \" href=\"UTD.htm?21/43/22194\">",
"       figure 1",
"      </a>",
"      and",
"      <a class=\"graphic graphic_figure graphicRef80271 \" href=\"UTD.htm?14/52/15171\">",
"       figure 2",
"      </a>",
"      ). The brain hormones signal the testicles to make a hormone called &ldquo;testosterone.&rdquo; They signal the ovaries to make a hormone called &ldquo;estrogen.&rdquo; Estrogen and testosterone cause the changes in the body.",
"     </p>",
"     <p>",
"      Late puberty can happen if this process doesn&rsquo;t happen on time. But it doesn&rsquo;t mean your child has a medical problem. Some children start puberty late because:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        They are growing more slowly than other children. This can be normal.",
"       </li>",
"       <li>",
"        Late puberty runs in their family. If a parent went through puberty late, chances are good that their child will, too. This is especially true for boys.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Other children start puberty late because of a medical problem or condition. These can include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        An abnormal growth or other problem in the brain, ovaries, or testicles",
"       </li>",
"       <li>",
"        A long-term illness or condition",
"       </li>",
"       <li>",
"        Problems caused by abnormal genes that babies can be born with",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Children (especially girls) can also start puberty late if they are too thin, don&rsquo;t eat enough, or exercise much more than normal. &nbsp;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H11142961\">",
"      <span class=\"h1\">",
"       Will my child need tests?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. If your child isn&rsquo;t showing any signs of puberty, the doctor or nurse will want to know why. He or she will talk with you and your child, and do an exam. He or she will also probably do:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Blood tests",
"       </li>",
"       <li>",
"        X-rays of 1 of your child&rsquo;s hands and wrists &ndash; These X-rays can show how fast your child is growing.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Depending on these results, the doctor might do other tests. These can include more blood tests or a CT scan, ultrasound, or other imaging test of your child&rsquo;s brain or belly. Imaging tests create pictures of the inside of the body.",
"     </p>",
"     <p>",
"      The doctor or nurse will also do repeat exams over time to follow your child&rsquo;s growth and development.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H11142976\">",
"      <span class=\"h1\">",
"       How is late puberty treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Treatment depends on your child&rsquo;s age and the cause of the late puberty.",
"     </p>",
"     <p>",
"      If puberty is late because of a medical problem, the doctor will treat the problem (if it can be treated). Different treatments might include medicines (such as hormones) or surgery. After treatment, your child will most likely start puberty.",
"     </p>",
"     <p>",
"      If your child is normal but growing slowly, or if late puberty runs in his or her family, treatment usually involves &ldquo;watching and waiting&rdquo; for puberty to start on its own.",
"     </p>",
"     <p>",
"      If your child is underweight or exercises too much, the doctor can give you advice about how to help your child get to a healthy weight and have a healthy lifestyle.",
"     </p>",
"     <p>",
"      Some children (mostly boys) who are normal but growing slowly are treated with hormone treatment to help start puberty. Doctors usually recommend this treatment only if late puberty is having a big impact on the child&rsquo;s life.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H11142991\">",
"      <span class=\"h1\">",
"       What else can I do to help my child?",
"      </span>",
"      &nbsp;&mdash;&nbsp;You can help your child feel good about him or herself. Point out your child&rsquo;s strengths instead of focusing on his or her body. Some children who start puberty late can have a hard time fitting in, because they look younger than other children their age.",
"     </p>",
"     <p>",
"      If your child is teased or treated badly, talk to the doctor or nurse about ways to get help.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H11143006\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?30/1/30738?source=see_link\">",
"       Patient information: Normal sexual development (puberty) (The Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?1/21/1363?source=see_link\">",
"       Patient information: Teen sexuality (The Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?1/12/1218?source=see_link\">",
"       Patient information: Acne (The Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?3/12/3266?source=see_link\">",
"       Patient information: My child is short (The Basics)",
"      </a>",
"     </p>",
