var title_f13_31_13819="Resection types sarcoma MSTS";
var content_f13_31_13819=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F56598&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F56598&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Types of resection for sarcomas, Musculoskeletal Tumor Society",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Term",
"       </td>",
"       <td class=\"subtitle1\">",
"        Definition",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Radical resection",
"       </td>",
"       <td>",
"        Whole tumor-bearing compartment removed en bloc",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Wide resection",
"       </td>",
"       <td>",
"        Tumor and its pseudocapsule removed en bloc surrounded by",
"healthy tissue within the tumor-bearing compartment",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Marginal resection",
"       </td>",
"       <td>",
"        Tumor is removed en bloc; however, the line of resection runs",
"through the pseudocapsule of the tumor; microscopic residual disease",
"likely",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Intralesional resection",
"       </td>",
"       <td>",
"        Tumor opened during surgery, surgical field contaminated;",
"microscopic or macroscopic residual disease is present",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     <p>",
"      Data from: Enneking WF, Spanier SS, Malawer MM. The effect of the anatomic setting on the results of surgical procedures for soft parts sarcoma of the thigh. Cancer 1981; 47:1005.",
"     </p>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
