var title_f13_31_13820="Supplies for skin biopsy";
var content_f13_31_13820=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F58432&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F58432&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Supplies for skin biopsy",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        Isopropyl alcohol, povidone-iodine, or chlorhexadine",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Sterile gauze, 3x3 or 4x4, and sterile cotton-tip",
"applicators",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Cloth or plastic fenestrated drape",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Syringes, 1 and 3 mL",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Needles, 22-gauge (to draw up solutions), 30-gauge (for",
"injection)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Lidocaine, 1 or 2 percent, with and without",
"epinephrine. May buffer with 1 part NaHCO3 to 9 parts lidocaine, but",
"must be refrigerated and disposed after 30 days",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Disposable surgical blades, 15 or 15c",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Disposable punches, 4, 6, and 8 mm",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Double-edge razor blade cut in half",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Small tissue forceps (Adson 4 3/4 inch, 1x2 teeth, 1 mm",
"tip)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Small tissue scissors (Grade 3 3/4 inch or tenotomy)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Needle holders, 4 1/2 or 5 inch, smooth jaws, small tip",
"(Webster 4 1/2 inch). Consider purchase of disposable suture kits with",
"needle holders, forceps, and scissors included.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        20 percent aluminum chloride",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        4-0 or 5-0 Nylon on C-17 or P-3 needles (4-0 for scalp)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Packaged alcohol swabs or tissues",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Antibiotic ointment or plain petrolatum",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Spot and rectangular Band-Aid",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Nonadherent dressings",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Paper tape",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Elastic wrap",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        10 percent formalin specimen bottle",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Surgical marking pen",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Pathology request forms",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Patient instructions",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     With permission from Alguire, PC, Mathes, BM, J Gen Intern Med 1998; 13:46.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
